import React from 'react';
import { ListGroup } from 'react-bootstrap';

const UserList = () => {
  // Mock data for users
  const users = [
    { id: 1, name: 'John Doe' },
    { id: 2, name: 'Jane Smith' },
    { id: 3, name: 'Bob Johnson' },
  ];

  return (
    <div>
      <h2>Lista użytkowników</h2>
      <ListGroup>
        {users.map((user) => (
          <ListGroup.Item key={user.id}>{user.name}</ListGroup.Item>
        ))}
      </ListGroup>
    </div>
  );
};

export default UserList;
